import './Botao.css'

const Botao = ({ nome, imagem }) => {

    const navigate = useNavigate();

    function handleClick(){
        console.log('Botao')
            navigate('/' + {nome})
    }

    return (
        <div className='botoes'>
            <button onClick={handleClick} key={nome}>
                <h2> {nome} </h2> 
                <img src={imagem} alt={nome}/>
            </button>
        </div>

    )
}

export default Botao
